import React from 'react';
import { Breadcrumb, BreadcrumbItem } from 'reactstrap';
import{Link} from'react-router-dom';

const Breadcrumb_nav = (props) => {
  return (
    <div>
      <Breadcrumb tag="nav" listTag="div">
        <Link to='/'><BreadcrumbItem to="/" href="">Home</BreadcrumbItem></Link>
        <BreadcrumbItem tag="a" href="#">Areas</BreadcrumbItem>
        <BreadcrumbItem tag="a" href="#">Talleres</BreadcrumbItem>
        <BreadcrumbItem active tag="span">Evaluacion</BreadcrumbItem>
      </Breadcrumb>
    </div>
  );
};

export default Breadcrumb_nav;
